class ChannelCodecs3Spec extends AnyFunSuite {

  test("basic serialization test (NORMAL)") {
    val data = normal
    val bin = DATA_NORMAL_Codec.encode(data).require
    val check = DATA_NORMAL_Codec.decodeValue(bin).require
    assert(data.commitments.localCommit.spec === check.commitments.localCommit.spec)
    assert(data === check)
  }

  test("encode/decode channel configuration options") {
    assert(channelConfigCodec.encode(ChannelConfig(Set.empty[ChannelConfigOption])).require.bytes === hex"00")
    assert(channelConfigCodec.decode(hex"00".bits).require.value === ChannelConfig(Set.empty[ChannelConfigOption]))
    assert(channelConfigCodec.decode(hex"01f0".bits).require.value === ChannelConfig(Set.empty[ChannelConfigOption]))
    assert(channelConfigCodec.decode(hex"020000".bits).require.value === ChannelConfig(Set.empty[ChannelConfigOption]))

    assert(channelConfigCodec.encode(ChannelConfig.standard).require.bytes === hex"0101")
    assert(channelConfigCodec.encode(ChannelConfig(ChannelConfig.FundingPubKeyBasedChannelKeyPath)).require.bytes === hex"0101")
    assert(channelConfigCodec.decode(hex"0101".bits).require.value === ChannelConfig(ChannelConfig.FundingPubKeyBasedChannelKeyPath))
    assert(channelConfigCodec.decode(hex"01ff".bits).require.value === ChannelConfig(ChannelConfig.FundingPubKeyBasedChannelKeyPath))
    assert(channelConfigCodec.decode(hex"020001".bits).require.value === ChannelConfig(ChannelConfig.FundingPubKeyBasedChannelKeyPath))
  }

  test("decode all known channel configuration options") {
    import scala.reflect.ClassTag
    import scala.reflect.runtime.universe._
    import scala.reflect.runtime.{universe => runtime}
    val mirror = runtime.runtimeMirror(ClassLoader.getSystemClassLoader)

    def extract[T: TypeTag](container: T)(implicit c: ClassTag[T]): Set[ChannelConfigOption] = {
      typeOf[T].decls.filter(_.isPublic).flatMap(symbol => {
        if (symbol.isTerm && symbol.isModule) {
          mirror.reflectModule(symbol.asModule).instance match {
            case f: ChannelConfigOption => Some(f)
            case _ => None
          }
        } else {
          None
        }
      }).toSet
    }

    val declaredOptions = extract(ChannelConfig)
    assert(declaredOptions.nonEmpty)
    val encoded = channelConfigCodec.encode(ChannelConfig(declaredOptions)).require
    val decoded = channelConfigCodec.decode(encoded).require.value
    assert(decoded.options === declaredOptions)
  }

  test("encode/decode optional shutdown script") {
    val remoteParams = RemoteParams(
      randomKey().publicKey,
      Satoshi(600),
      UInt64(123456L),
      Satoshi(300),
      MilliSatoshi(1000),
      CltvExpiryDelta(42),
      42,
      randomKey().publicKey,
      randomKey().publicKey,
      randomKey().publicKey,
      randomKey().publicKey,
      randomKey().publicKey,
      Features(ChannelRangeQueries -> Optional, VariableLengthOnion -> Mandatory, PaymentSecret -> Mandatory),
      None)
    assert(remoteParamsCodec.decodeValue(remoteParamsCodec.encode(remoteParams).require).require === remoteParams)
    val remoteParams1 = remoteParams.copy(shutdownScript = Some(ByteVector.fromValidHex("deadbeef")))
    assert(remoteParamsCodec.decodeValue(remoteParamsCodec.encode(remoteParams1).require).require === remoteParams1)

    val dataWithoutRemoteShutdownScript = normal.copy(commitments = normal.commitments.copy(remoteParams = remoteParams))
    assert(DATA_NORMAL_Codec.decode(DATA_NORMAL_Codec.encode(dataWithoutRemoteShutdownScript).require).require.value === dataWithoutRemoteShutdownScript)

    val dataWithRemoteShutdownScript = normal.copy(commitments = normal.commitments.copy(remoteParams = remoteParams1))
    assert(DATA_NORMAL_Codec.decode(DATA_NORMAL_Codec.encode(dataWithRemoteShutdownScript).require).require.value === dataWithRemoteShutdownScript)
  }

  test("backward compatibility DATA_NORMAL_COMPAT_02_Codec") {
    val oldBin = hex""
    val decoded1 = stateDataCodec.decode(oldBin.bits).require.value
    assert(decoded1.asInstanceOf[DATA_NORMAL].closingFeerates === None)
    val newBin = stateDataCodec.encode(decoded1).require.bytes
    // make sure that encoding used the new codec
    assert(newBin.startsWith(hex"0007"))
    val decoded2 = stateDataCodec.decode(newBin.bits).require.value
    assert(decoded1 === decoded2)
  }

  test("backward compatibility DATA_SHUTDOWN_COMPAT_03_Codec") {
    val oldBin = hex""
    val decoded1 = stateDataCodec.decode(oldBin.bits).require.value
    assert(decoded1.asInstanceOf[DATA_SHUTDOWN].closingFeerates === None)
    val newBin = stateDataCodec.encode(decoded1).require.bytes
    // make sure that encoding used the new codec
    assert(newBin.startsWith(hex"0008"))
    val decoded2 = stateDataCodec.decode(newBin.bits).require.value
    assert(decoded1 === decoded2)
  }

  test("backward compatibility with legacy claim-htlc-success transactions") {
    // We can decode old data that didn't contain a payment hash.
    val oldTxWithInputInfoCodecBin = hex"0004 "
    val oldClaimHtlcTxBin = hex"01 "
    val legacyClaimHtlcSuccess = {
      val claimHtlcSuccessTx1 = txWithInputInfoCodec.decode(oldTxWithInputInfoCodecBin.bits).require.value
      val claimHtlcSuccessTx2 = claimHtlcTxCodec.decode(oldClaimHtlcTxBin.bits).require.value
      assert(claimHtlcSuccessTx1 === claimHtlcSuccessTx2)
      assert(claimHtlcSuccessTx1.isInstanceOf[LegacyClaimHtlcSuccessTx])
      claimHtlcSuccessTx1.asInstanceOf[LegacyClaimHtlcSuccessTx]
    }

    // We can encode data that contains a payment hash.
    val claimHtlcSuccess = ClaimHtlcSuccessTx(legacyClaimHtlcSuccess.input, legacyClaimHtlcSuccess.tx, ByteVector32(hex"0101010101010101010101010101010101010101010101010101010101010101"), legacyClaimHtlcSuccess.htlcId, BlockHeight(0))
    val txWithInputInfoCodecBin = txWithInputInfoCodec.encode(claimHtlcSuccess).require.bytes
    assert(txWithInputInfoCodecBin !== oldTxWithInputInfoCodecBin)
    val claimHtlcTxBin = claimHtlcTxCodec.encode(claimHtlcSuccess).require.bytes
    assert(claimHtlcTxBin !== oldClaimHtlcTxBin)

    // And decode new data that contains a payment hash.
    val decoded1 = txWithInputInfoCodec.decode(txWithInputInfoCodecBin.bits).require.value
    assert(claimHtlcSuccess === decoded1)
    val decoded2 = claimHtlcTxCodec.decode(claimHtlcTxBin.bits).require.value
    assert(claimHtlcSuccess === decoded2)
  }

  test("backward compatibility with transactions missing a confirmation target") {
    {
      val oldAnchorTxBin = hex"0011 "
      val oldAnchorTx = txWithInputInfoCodec.decode(oldAnchorTxBin.bits).require.value
      assert(oldAnchorTx.isInstanceOf[ClaimLocalAnchorOutputTx])
      assert(oldAnchorTx.asInstanceOf[ClaimLocalAnchorOutputTx].confirmBefore === BlockHeight(0))
      val anchorTx = oldAnchorTx.asInstanceOf[ClaimLocalAnchorOutputTx].copy(confirmBefore = BlockHeight(1105))
      val anchorTx2 = txWithInputInfoCodec.decode(txWithInputInfoCodec.encode(anchorTx).require).require.value
      assert(anchorTx === anchorTx2)
    }
    {
      val oldHtlcSuccessTxBin = hex"0002 "
      val oldHtlcSuccessTx = txWithInputInfoCodec.decode(oldHtlcSuccessTxBin.bits).require.value
      assert(oldHtlcSuccessTx.isInstanceOf[HtlcSuccessTx])
      assert(oldHtlcSuccessTx.asInstanceOf[HtlcSuccessTx].confirmBefore === BlockHeight(0))
      val htlcSuccessTx = oldHtlcSuccessTx.asInstanceOf[HtlcSuccessTx].copy(confirmBefore = BlockHeight(1105))
      val htlcSuccessTx2 = txWithInputInfoCodec.decode(txWithInputInfoCodec.encode(htlcSuccessTx).require).require.value
      assert(htlcSuccessTx === htlcSuccessTx2)
    }
    {
      val oldHtlcTimeoutTxBin = hex"0003 "
      val oldHtlcTimeoutTx = txWithInputInfoCodec.decode(oldHtlcTimeoutTxBin.bits).require.value
      assert(oldHtlcTimeoutTx.isInstanceOf[HtlcTimeoutTx])
      assert(oldHtlcTimeoutTx.asInstanceOf[HtlcTimeoutTx].confirmBefore === BlockHeight(0))
      val htlcTimeoutTx = oldHtlcTimeoutTx.asInstanceOf[HtlcTimeoutTx].copy(confirmBefore = BlockHeight(1105))
      val htlcTimeoutTx2 = txWithInputInfoCodec.decode(txWithInputInfoCodec.encode(htlcTimeoutTx).require).require.value
      assert(htlcTimeoutTx === htlcTimeoutTx2)
    }
    {
      val oldClaimHtlcSuccessTxBin = hex"0016 "
      val oldClaimHtlcSuccessTx = txWithInputInfoCodec.decode(oldClaimHtlcSuccessTxBin.bits).require.value
      assert(oldClaimHtlcSuccessTx.isInstanceOf[ClaimHtlcSuccessTx])
      assert(oldClaimHtlcSuccessTx.asInstanceOf[ClaimHtlcSuccessTx].confirmBefore === BlockHeight(0))
      val claimHtlcSuccessTx = oldClaimHtlcSuccessTx.asInstanceOf[ClaimHtlcSuccessTx].copy(confirmBefore = BlockHeight(1105))
      val claimHtlcSuccessTx2 = txWithInputInfoCodec.decode(txWithInputInfoCodec.encode(claimHtlcSuccessTx).require).require.value
      assert(claimHtlcSuccessTx === claimHtlcSuccessTx2)
    }
    {
      val oldClaimHtlcTimeoutTxBin = hex"0005 "
      val oldClaimHtlcTimeoutTx = txWithInputInfoCodec.decode(oldClaimHtlcTimeoutTxBin.bits).require.value
      assert(oldClaimHtlcTimeoutTx.isInstanceOf[ClaimHtlcTimeoutTx])
      assert(oldClaimHtlcTimeoutTx.asInstanceOf[ClaimHtlcTimeoutTx].confirmBefore === BlockHeight(0))
      val claimHtlcTimeoutTx = oldClaimHtlcTimeoutTx.asInstanceOf[ClaimHtlcTimeoutTx].copy(confirmBefore = BlockHeight(1105))
      val claimHtlcTimeoutTx2 = txWithInputInfoCodec.decode(txWithInputInfoCodec.encode(claimHtlcTimeoutTx).require).require.value
      assert(claimHtlcTimeoutTx === claimHtlcTimeoutTx2)
    }
  }

  test("txGenerationResultCodec codec") {
    val inputInfo = InputInfo(OutPoint(randomBytes32(), 42), TxOut(123456L sat, randomBytes(90)), randomBytes(128))
    val tx = Transaction.read("")
    val claimHtlcTimeoutTx = ClaimHtlcTimeoutTx(inputInfo, tx, 74846, BlockHeight(800000))
    val txResult = TxGenerationResult.Success(claimHtlcTimeoutTx)

    val codec = txGenerationResultCodec(claimHtlcTimeoutTxCodec)
    assert(codec.decode(codec.encode(txResult).require).require == DecodeResult(txResult, BitVector.empty))
  }

